		$(function () {
			
			function handle_range(range) {
				try {
					if (range) {
						if (range.type === 'datachange') {//数据改变  luckyhsheet 目前只支持一次性改变连续的表格区间的  数据
							let updated_obj = {
								"sheetIndex": range.sheetIndex, //sheet 索引
								"type": range.type, //变更类型
								"range": range.range[0], //   变更范围
								"data": [],//  变更的数据
								"calc": [], //存储公式链     curHyperlink
								"hyperlink": range.curHyperlink, //存储链接
								"config": range.curConfig,
							};
							let range_data = range.range[0];
							for (let i = range_data.row[0]; i <= range_data.row[1]; i++) {//选取行
								for (let j = range_data.column[0]; j <= range_data.column[1]; j++) {//选取列
									updated_obj.data.push(range.curdata[i][j]);
								}
							}

							// 处理公式链
							if (range.calc) {   //undefined 好像不会被发送
								updated_obj.calc = range.calc;
							}
							return updated_obj;
						} else if (range.type === 'update_frozen') //修改冻结功能
						{
							return {
								"sheetIndex": range.sheetIndex, //sheet 索引
								"type": range.type, //变更类型
								"frozen": range.frozen, //   变更范围
							};
						} else if (range.type === "mergeChange") //合并单元格
						{
							// 设置一个合并单元格，需要处理两个地方，一是单元格对象中设置mc属性，二是在config中设置merge。
							let updated_obj = {
								"sheetIndex": range.sheetIndex, //sheet 索引
								"type": range.type, //变更类型
								"range": range.range[0], //   变更范围
								"data": [],//  变更的单元格mc
								"config_merge": range.curConfig.merge, //config.merge
							};
							//处理合并行以后受影响的数据
							let range_data = range.range[0];
							// if(range_data.row[0] ===  range_data.row[1] && range_data.column[0]===range_data.column[1]){
							//     window.ElementPlus.ElMessage({
							//         message: "更新失败，请刷新重试！",
							//         type: 'error',
							//         showClose: true,
							//     });
							//     return null;
							// }
							for (let i = range_data.row[0]; i <= range_data.row[1]; i++) {//选取行
								for (let j = range_data.column[0]; j <= range_data.column[1]; j++) {//选取列
									updated_obj.data.push(range.curData[i][j]);
								}
							}
							return updated_obj;
						} else if (range.type === "add_custom_row_and_data") {
							// 添加自定义行数据
							let updated_obj = {
								"sheetIndex": String(range.sheetIndex), //sheet 索引
								"type": range.type, //变更类型
								"data": range.data,//  变更的数据
							};
							return updated_obj;
						} else if (range.type === "addRC") {
							let updated_obj = {
								"sheetIndex": range.sheetIndex, //sheet 索引
								"type": range.type, //变更类型
								"range": range.range[0], //   变更范围
								"data": [],//  变更的数据
								"ctrlValue": range.ctrlValue, //记录了当前
								"rowlen": range.curConfig ? range.curConfig.rowlen ? range.curConfig.rowlen : {} : {},
								"columnlen": range.curConfig ? range.curConfig.columnlen ? range.curConfig.columnlen : {} : {},
								"congfig": range.config ? range.config : {},
								"curConfig": range.curConfig ? range.curConfig : {},
							};
							if (range.ctrlValue.rc === 'r') { //行相关
								if (!range.ctrlValue.direction) {//底部新增行
									range.ctrlValue.direction = null;//方便后端做判断
									//底部新增行
									for (let i = range.ctrlValue.index; i < range.ctrlValue.index + range.ctrlValue.len; i++) {//选取行
										updated_obj.data.push(range.curData[i]);
									}
									return updated_obj;
								} else if (range.ctrlValue.direction === 'rightbottom') {//向下增加行
									//
									for (let i = range.ctrlValue.index + 1; i <= range.ctrlValue.index + range.ctrlValue.len; i++) {//选取行
										updated_obj.data.push(range.curData[i]);
									}
									return updated_obj;
								}
								// else if(range.ctrlValue.direction ==='lefttop'){ //向上新增行
								else { // 向上新增行
									for (let i = range.ctrlValue.index - 1; i >= range.ctrlValue.index - range.ctrlValue.len; i--) {//选取行
										updated_obj.data.push(range.curData[i]);
									}
									return updated_obj;
								}
							} else { //列相关 range.ctrlValue.rc === 'c'
								if (range.ctrlValue.direction === 'lefttop') {//左边新增列
									//处理合并行以后受影响的数据
									let range_data = range.range[0];
									// let  limit = 0;
									// otterLoop:
									for (let i = range_data.row[0]; i <= range_data.row[1]; i++) {//选取行
										for (let j = range.ctrlValue.index; j < range.ctrlValue.index + range.ctrlValue.len; j++) {//选取列
											updated_obj.data.push(range.curData[i][j]);
											// limit++;
											// if(limit >=1){
											//     break otterLoop;
											// }
										}
									}
									return updated_obj;
								} else {//右边新增列  rightbottom
									let range_data = range.range[0];
									for (let i = range_data.row[0]; i <= range_data.row[1]; i++) {//选取行
										for (let j = range.ctrlValue.index + 1; j <= range.ctrlValue.index + range.ctrlValue.len; j++) {//选取列
											updated_obj.data.push(range.curData[i][j]);
										}
									}
									return updated_obj;
								}
							}
						} else if (range.type === "delRC") {//删除行列
							let updated_obj = {
								"sheetIndex": range.sheetIndex, //sheet 索引
								"type": range.type, //变更类型
								"range": range.range[0], //   变更范围
								"data": [],//  变更的数据
								"ctrlValue": range.ctrlValue, //记录了当前
								"congfig": range.config ? range.config : {},
								"curConfig": range.curConfig ? range.curConfig : {},
							};
							if (range.ctrlValue.rc === 'r') {//删除行
								return updated_obj;
							} else { //删除列
								return updated_obj;
							}
						} else if (range.type === 'resize') {//调整行高或列宽
							let updated_obj = {
								"sheetIndex": range.sheetIndex, //sheet 索引
								"type": range.type, //变更类型
								"data": [],//  变更的数据
								"ctrlType": range.ctrlType //记录了当前
							};
							if (range.ctrlType === "resizeR" || range.ctrlType === "resizeC") {//调整行高 或列宽
								updated_obj.data.push(range.curconfig);
								updated_obj.data.push(range.curImages);
							}
							return updated_obj;
						} else if (range.type === "sheetName") { //重命名sheet
							return range;
						} else if (range.type === "addSheet") {
							//一种是sheet
							//一种是数据透视表
							return {
								"sheetIndex": range.currentSheetIndex, //sheet 索引
								"type": range.type, //变更类型
								"sheetconfig": range.sheetconfig,
							};
						} else if (range.type === "copySheet" || range.type === "sheetColor") {// 添加sheet或 复制sheet 或 改变sheet颜色
							return range;
						} else if (range.type === "deleteSheet") { //删除sheet
							return {
								"sheetIndex": range.index, //sheet 索引
								"type": range.type, //变更类型
							};
						} else if (range.type === "imageCtrl") {//图片更改
							return {
								"sheetIndex": range.sheetIndex, //sheet 索引
								"type": range.type, //变更类型
								"curImages": range.curImages,//  变更的数据
							};
						} else if (range.type === "updateHyperlink") {//插入链接
							let updated_obj = {
								"sheetIndex": range.sheetIndex, //sheet 索引
								"type": range.type, //变更类型
								"range": range.range[0], //   变更范围
								"data": [],//  变更的数据
								"hyperlink": range.currentHyperlink ? range.currentHyperlink : range.historyHyperlink//存储公式链
							};
							let range_data = range.range[0];
							for (let i = range_data.row[0]; i <= range_data.row[1]; i++) {//选取行
								for (let j = range_data.column[0]; j <= range_data.column[1]; j++) {//选取列
									updated_obj.data.push(range.curData[i][j]);
								}
							}
							return updated_obj;
						} else if (range.type === "postil") { //批注管理
							// new_range = Object.assign([], range)
							let updated_obj = {
								"sheetIndex": range.sheetIndex, //sheet 索引
								"type": range.type, //变更类型
								"range": range.rc, //   变更范围
								"data": [],//  变更的数据
							};
							// "找到修改的数据范围"
							let range_data = range.rc;
							// let firstElement = range.rc[0];
							// let [row, column] = firstElement.split('_').map(Number);
							for (let i = 0; i < range_data.length; i++) {
								//取出元素找到范围的数据
								let [row, column] = range_data[i].split('_').map(Number);
								updated_obj.data.push(range.curdata[row][column]);
							}
							return updated_obj;
						} else if (range.type === "zoomChange") { //缩放级别
							// return {
							//     "sheetIndex": range.sheetIndex, //sheet 索引
							//     "type": range.type, //变更类型
							//     "curZoomRatio": range.curZoomRatio,//  当前配置
							// };
							return {}; // 缩放级别的数据不用保存
						} else if (range.type === "borderChange") {//边框管理
							return {
								"sheetIndex": range.sheetIndex, //sheet 索引
								"type": range.type, //变更类型
								"curconfig": range.curconfig,//  当前配置
							};
						} else if (range.type === "updateDataVerification") { //数据验证管理
							return {
								"sheetIndex": range.sheetIndex, //sheet 索引
								"type": range.type, //变更类型
								"currentDataVerification": range.currentDataVerification//  当前数据验证
							};
						} else if (range.type === "update_protect" || range.type === "update_pritect") { //更新工作表保护
							return {
								// "sheetIndex": parseInt(range.sheetIndex, 10), // 转成10 进制
								"sheetIndex": range.sheetIndex,
								"type": range.type, //变更类型
								"authority": range.config.authority//  当前数据验证
							};
						} else if (range.type === "datachangeAll_filter") { //详细 筛选条件   设置 filter对象
							let updated_obj = {
								"sheetIndex": range.sheetIndex,
								"type": range.type, //变更类型
								"filter": {} //  详细筛选条件
							};
							let column = JSON.stringify(range.optionsindex);
							updated_obj.filter = {
								[column]: {
									"caljs": range.caljs,
									"optionstate": range.optionstate,
									"rowhidden": range.curconfig.rowhidden,
									"cindex": column, // 当前范围列顺序，表示第几列
									"str": "", // 范围，起始行
									"edr": "", // 范围，结束行
									"stc": "", // 范围，起始列
									"edc": "" // 范围，结束列
								}
							};
							return updated_obj;
						} else if (range.type === "datachangeAll_filter_clear") { //清空筛选条件
							return {
								"sheetIndex": range.sheetIndex,
								"type": range.type, //变更类型
								"filter_save": range.filter_save//
							};
						} else if (range.type === "filtershow") { // 筛选 设置filter_save对象
							return {
								"sheetIndex": range.sheetIndex,
								"type": range.type, //变更类型
								"filter_save": range.filter_save//
							};
						} else if (range.type === "updateCF") { //更新规则
							return {
								"sheetIndex": range.sheetIndex,
								"type": range.type, //变更类型
								"currentRules": range.data.currentRules
							};
						} else if (range.type === "showHidCols") {
							//     隐藏列或显示列
							// 将对应curConfig 里面的添加到对rowchidden 和 colhidden     添加到后端
							return {
								"sheetIndex": range.sheetIndex,
								"type": range.type,
								"row_and_col_hidden": {
									"colhidden": range.curconfig.colhidden ? range.curconfig.colhidden : {},
									"rowhidden": range.curconfig.rowhidden ? range.curconfig.rowhidden : {},
								}
							};
						}

					}
				} catch (e) {
					window.ElementPlus.ElMessage({
						message: "更新失败，请刷新重试！",
						type: 'error',
						showClose: true,
					});
					return null;
				}
			};

			// According to the browser language
			var lang = luckysheetDemoUtil.language() === 'zh' ? 'zh' : 'en';

				"pivotTable": null,//系统自动产生
				"isPivotTable": false//系统自动产生
			};
			// window.luckysheet.sheetmanage.setCustomSheet(customSheetconfig);//设置自定义sheet
			luckysheet.create(options);
			function get_data() {
				console.log(JSON.stringify(window.luckysheet.getAllSheets()))
				var infoDiv = document.getElementById("infoDiv");

				// 设置需要显示的信息
				var info = JSON.stringify(window.luckysheet.getAllSheets());

				// 将信息添加到div中
				infoDiv.innerHTML = info;

			}
			function clear() {
				var infoDiv = document.getElementById("infoDiv");
				infoDiv.innerHTML = "";
			}
			// 绑定按钮点击事件
			// document.getElementById("myButton").addEventListener("click", get_data);
			document.getElementById("copy_data_btn").addEventListener("click", get_and_copy_data);
		})
	</script>
	<style>
		/* 自定义loading演示样式 */
		@keyframes loading-rotate {
			0% {
				transform: rotate(0deg);
			}

			100% {
				transform: rotate(360deg);
			}
		}

		@keyframes loading-dash {
			0% {
				stroke-dasharray: 1, 200;
				stroke-dashoffset: 0;
			}

			50% {
				stroke-dasharray: 90, 150;
				stroke-dashoffset: -40px;
			}

			100% {
				stroke-dasharray: 90, 150;
				stroke-dashoffset: -120px;
			}
		}

		.loadingAnimation {
			width: 3em;
			height: 3em;
			animation: loading-rotate 2s linear infinite;
		}

		.loadingAnimation circle {
			animation: loading-dash 1.5s ease-in-out infinite;
			stroke-dasharray: 90, 150;
			stroke-dashoffset: 0;
			stroke-width: 2;
			stroke: currentColor;
			stroke-linecap: round;
		}
	</style>
